Que Dios Teemo Todopoderoso te maldiga y te haga feedear en todas tus partidas de aquí a un año, por tener el atrevimiento de referirse de esa forma a su Divinidad.
Larga vida a Dios Teemo, tus humildes adoradores te defenderemos de posts como este hasta el día de nuestras muertes.
